import classNames from "classnames/bind";

import styles from "./List.module.scss";
import { useEffect, useState } from "react";
import { getResult } from "../../../../Services/result";

const cx = classNames.bind(styles)

function ListResult() {

    const [data, SetData] = useState("");

    useEffect
    const resultData = getResult()

    return (
        <section className={cx("warpper")}>
            <table className={cx("table")}>
                <thead>
                    <tr>
                        <th>Name</th>
                        <th>Degree</th>
                        <th>Date</th>
                        <th>School Name</th>
                        <th>Describe</th>
                        <th>Action</th>
                    </tr>
                </thead>
                <tbody>
                    <tr>
                        <td>Name</td>
                        <td>Degree</td>
                        <td>Date</td>
                        <td>School Name</td>
                        <td>Describe</td>
                        <td>
                            <button className={cx("Delete")}>Delete</button>
                            <button className={cx("Edit")}>Edit</button>
                        </td>
                    </tr>
                </tbody>
                
            </table>
        </section>
    )
}

export default ListResult;
